# 创建表
CREATE TABLE `lkl_region` (
  `adcode` int(10) unsigned NOT NULL COMMENT '地理行政单位代码',
  `padcode` int(10) unsigned DEFAULT '0' COMMENT '上级行政单位代码',
  `name` varchar(30) DEFAULT NULL COMMENT '地理行政单位名称',
  `ahead` char(1) DEFAULT NULL,
  `short` varchar(20) DEFAULT NULL COMMENT '首字母简拼',
  `pinyin` varchar(60) DEFAULT NULL COMMENT '拼音全拼',
  `citycode` varchar(4) DEFAULT NULL COMMENT '城市代码',
  `center` varchar(30) DEFAULT '' COMMENT '行政中心经纬度',
  `level` varchar(20) DEFAULT '' COMMENT '地理行政单位分级 provice省级 city市级 district区县级',
  `status` tinyint(4) unsigned DEFAULT '0' COMMENT '状态 0正常  1停用',
  PRIMARY KEY (`adcode`) USING BTREE,
  KEY `lkl_region_padcode` (`padcode`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

